import { RegistrationProps } from "./Registartion";
import React, { FC } from "react";

const RegistrationPage: FC<RegistrationProps> = ({ isActive, setActive }) => {
  return (
    <>
      <div className="w-screen flex items-center justify-center fixed h-screen  bg-fix top-50 left-0">
        <div className="flex flex-col items-center content-center text-4xl bg-cyan-500 w-1/3">
          <div className="mb-10">
            <h2>Регистрация</h2>
          </div>
          <div className="flex flex-col items-center content-center gap-8">
            <input placeholder="Логин" />
            <input placeholder="Пароль" />
            <input placeholder="Повторите пароль" />
            <button
              onClick={setActive}
              className="rounded-3xl text-3xl w-[250px] h-[40px] uppercase text-white bg-green-300 hover:transition-all hover:opacity-80"
            >
              регистрация
            </button>
          </div>
        </div>
      </div>
    </>
  );
};

export default RegistrationPage;
